g2:c.PROCEDURE.g2:a.TEXT:
util-change-size(O: class item, x: integer, y: integer)

L, R, T, B: integer;

begin
    L = truncate(the item-x-position of O - x / 2);
    R = truncate(the item-x-position of O + x / 2);
    T = truncate(the item-y-position of O + y / 2);
    B = truncate(the item-y-position of O - y / 2);
    call g2-change-size-of-item-per-area(O, L, T, R, B, the symbol DEFAULT);
    if the name-box of O exists then
	conclude that the name-box of O = structure(color:
structure(background-color: the symbol transparent, text-color: the symbol
foreground), position: structure(x-offset: 10, y-offset: 15));
end

small-size-chart-test(node: class benchmark-node)

    s: symbol;
    t: text;
    w: class g2-window;
    has-twng: truth-value;
    wait-cnt: integer;
begin
    wait-cnt = 0;
    has-twng = false;
    repeat
        for w = each g2-window do
            if the g2-window-client-version of w /= structure() and the program of the g2-window-client-version of w = the symbol TWNG then
                has-twng = true;
        end;
        exit if has-twng;
        wait-cnt = wait-cnt + 1;
        exit if wait-cnt > 20;
        wait for 1 seconds;
    end;
    
    if not(has-twng) then begin
        call fail(node, "twng does not started at all");
        return;
    end;
    
    show sub-ws-of-test at the top left corner of the screen;
    wait for 1 seconds;
    call util-change-size(chart-inst, 40, 40);
    wait for 1 seconds;
    has-twng = false;
    for w = each g2-window do
        if the g2-window-client-version of w /= structure() and the program of the g2-window-client-version of w = the symbol TWNG then
            has-twng = true;
    end;
    if has-twng then
        call pass(node)
    else
        call fail(node, "twng exit for too small size of chart");
end on error(s, t)
    call fail(node, t);
end
